in
{ general = { stop_time = (toString StopTimeSec) + "s"; }; network = { graph = { type = "1_gbit_switch"; }; }; hosts = { fast_client = FastHost // { processes = [ {path = ClientPath;} CleanupProcess ]; }; slow_client = SlowHost // { processes = [ {path = ClientPath;} CleanupProcess ]; }; fast_server = FastHost // { processes = [ {path = ServerPath;} CleanupProcess ]; }; slow_server = SlowHost // { processes = [ {path = ServerPath;} CleanupProcess ]; }; };
} This can be converted to JSON, which is also valid YAML, with: nix eval -f example.nix --json
